import React from 'react';
import MovieList from './MovieList.js';
import Header from './HeaderApp.js';
class DefaultView extends React.Component {
    constructor(props){
        super(props);
    }
    render()
    {
        console.log("header");
        return(
            <div>
                <Header />
                <section>
                    <MovieList movies={this.props.movies} />
                </section>
            </div>
        );
        console.log('done');
    }
}

export default DefaultView;
